import re

def createArray(s):
    '''takes data and transfom it to an int array in python syntax'''
    a=s.split(" ")
    return a

def printArray(arr):
    for i in arr:
        print(i,end=' ')

def merge(data):
    '''takes sorted arrays and merge them and return the new array'''
    a=data.split('\n')
    arr1=createArray(a[1]);arr2=createArray(a[3])
    a= __merge__(arr1,arr2)
    return a

def __merge__(arr1,arr2):
    '''takes 2 sorted arrays and merge them'''
    arr=[0*x for x in range((len(arr1)+len(arr2)))];i=0;j=0;k=0
    # print(i<len(arr1) and j<len(arr2))
    while i<len(arr1) and j<len(arr2):
        # print(str(arr1[i]),str(arr2[j]),int(arr1[i])<int(arr2[j]))
        if int(arr1[i])<int(arr2[j]):
            arr[k]=arr1[i];i+=1;k+=1
        else :
            arr[k]=arr2[j];j+=1;k+=1
    #if i is still <len(arr1)
    while i!=len(arr1):
        arr[k]=arr1[i];i+=1;k+=1
    #if j is still <len(arr2)
    while j!=len(arr2):
        arr[k]=arr2[j];j+=1;k+=1
    return arr

